import React from 'React';
import Link from 'next/Link';
import Header from '../components/shared/Header'

class About extends React.Component {

    render() {
        return (
            <div>
                <p>This is the about page.</p>
                <Link href="/">
                    <a>Home Page</a>
                </Link>
            </div>
        )
    }
}

export default About;
